def generate_feedback_xml(results)
  items = results.map do |r|
    character = r[:character]
    friendlyName = r[:friendlyName]

    "<item uid=\"#{character}\" arg=\"#{character}\" valid=\"YES\" autocomplete=\"#{friendlyName}\">
      <icon></icon>
      <title>#{character}</title>
      <subtitle>#{friendlyName}</subtitle>
    </item>"
  end

  "<?xml version=\"1.0\"?><items>" + items.inject("", :+) + "</items>"
end

# Get and check input values
input = "{query}".downcase.split " "
if input == nil || input.length == 0 || input.all? { |x| x.length < 2 }
  puts "Not enough input"
  return
end

results = []

index.each do |pair|
  code = pair[0]
  name = pair[1].downcase

  if (input.all? { |x| name.include? x })
    character = OSX::NSString.stringWithFormat("%C", code)
    results << { :character => character, :friendlyName => name.capitalize }
  end
end

if results.length > 0
  puts generate_feedback_xml results.uniq
end
